import { initializeApp } from "firebase/app";
import { getStorage } from "firebase/storage";

const firebaseConfig = {
  apiKey: "",
  authDomain: "",
  projectId: "event-helper-online",
  storageBucket: "event-helper-online.appspot.com",
  messagingSenderId: "731858477545",
  appId: "1:731858477545:web:fa639f52287b16f6efeb78",
};

const app = initializeApp(firebaseConfig);
const storage = getStorage(app);

export { storage };
